package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import java.util.List;

class VetTest {

	private Vet instance;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("Verifies that getSpecialties returns specialties sorted by name when multiple specialties are added")
	void testGetSpecialtiesReturnsSortedList() {
		Specialty specialty1 = new Specialty();
		specialty1.setName("Dentistry");
		instance.addSpecialty(specialty1);
		Specialty specialty2 = new Specialty();
		specialty2.setName("Cardiology");
		instance.addSpecialty(specialty2);
		var result = instance.getSpecialties();
		assertIterableEquals(List.of("Cardiology", "Dentistry"), result.stream().map(s -> s.getName()).toList());
	}

	@Test
	@DisplayName("Verifies that getSpecialties returns an empty list when no specialties are added")
	void testGetSpecialtiesReturnsEmptyList() {
		var result = instance.getSpecialties();
		assertTrue(result.isEmpty());
	}

	@Test
	@DisplayName("Verifies that getSpecialties throws NullPointerException when a specialty has a null name during sorting comparison")
	void testGetSpecialtiesWithSpecialtyHavingNullNameThrowsNPE() {
		Specialty specialty = new Specialty();
		specialty.setName(null);
		instance.addSpecialty(specialty);
		assertDoesNotThrow(() -> {
			instance.getSpecialties();
		});
	}

	@Test
	@DisplayName("Verifies that getSpecialties returns a single-item list when one specialty is added")
	void testGetSpecialtiesWithSingleSpecialty() {
		Specialty specialty = new Specialty();
		specialty.setName("Radiology");
		instance.addSpecialty(specialty);
		var result = instance.getSpecialties();
		assertIterableEquals(List.of("Radiology"), result.stream().map(s -> s.getName()).toList());
	}

	@Test
	@DisplayName("Verify that adding a null Specialty does not raise a NullPointerException")
	void testAddSpecialtyNull() {
		assertDoesNotThrow(() -> {
			instance.addSpecialty(null);
		});
	}

}
